import photo from "../images/background.jpg"
import Trainers from "./Trainers";

const TrainerAtHome = ({ trainer }) => {

  return (
    <div className="trainer">
      <img className="pps" src={photo} />
      <div className="trainer-name-home">{trainer.firstName}</div>
    </div>
  )

}

export default TrainerAtHome;
